import React from 'react';
import styles from '../styles/About.module.css';
import skillsData from '../assets/data/skills.json';

const About = () => {
    return (
        <div className={styles.aboutContainer}>
            <h1>Sobre mí</h1>
            <p>Hola, soy Marta Cuevas, ingeniera de la salud. Me apasiona mejorar la calidad de vida de las personas a través de la tecnología y la innovación en el sector salud.</p>

            <h2>Habilidades</h2>
            <ul>
                {skillsData.map((skill, index) => (
                    <li key={index}>{skill}</li>
                ))}
            </ul>

            <h2>Herramientas</h2>
            <ul>
                <li>Python</li>
                <li>JavaScript</li>
                <li>React</li>
                <li>Node.js</li>
                <li>SQL</li>
                <li>HTML/CSS</li>
            </ul>
        </div>
    );
};

export default About;
